import React from 'react';
import logo from './logo.svg';
import './App.css';
import SideMenu from './components/Menu/SideMenu';
import Main from './components/Main/Main';
import Header from'./components/Header';

function App() {
  return (
    <div>
      <SideMenu></SideMenu>
      <div style={{display:"inline"}}>
        <Header></Header>
        <Main></Main>
      </div>
    </div>
  );
}

export default App;
